import PropTypes from 'prop-types';
//React arrow component
const Header = ({title}) =>{
    return (
        <header>
            <h1>{title}</h1>
            <h2>Up there is Title</h2>
        </header>
    )
}

Header.defaultProps = {
    title:'Task Tracker'
}

Header.propTypes = {
    title: PropTypes.string
}

export default Header ;
